import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPrescriptionBottle, faBroadcastTower, faCoffee, faDiagnoses, faDatabase } from '@fortawesome/fontawesome-free-solid'
import "./sidebar.css"
import { Button } from 'react-bootstrap';
const Sidebar = () => {
    return (
        <div className="bg-success min-vh-100">
         <FontAwesomeIcon icon={faDiagnoses} />  <Button>Add doctor</Button> <br/><br/>
        <FontAwesomeIcon icon={faPrescriptionBottle} /> <Button>Appointment</Button><br/><br/>
        <FontAwesomeIcon icon={faDatabase} /> <Button>Dashboard</Button>
        </div>
    );
};

export default Sidebar;
